const communityForm = () => {
  return (
    <div>
      <h2>Building the community</h2>
      <p>
        Call to action about uplifting community and local companies via
        technology
      </p>
      <form>
        <input placeholder="name" />
        <input placeholder="email" />
        <input placeholder="messages" />
      </form>
    </div>
  );
};
export default communityForm;
